import React from "react";

interface City {
  city_name: string;
  temp: string;
  humidity: string;
}

export default function SavedCity(props: City) {
  return (
    <div className="flex items-center justify-evenly  space-y-8 border border-black">
      <div className="flex items-center">
        <h2 className="m-0">{props.city_name}</h2>
        <h2>{props.temp}</h2>
        <h2>{props.humidity}</h2>
      </div>
      <svg
        xmlns="http://www.w3.org/2000/svg"
        className="h-6 w-6"
        fill="none"
        viewBox="0 0 24 24"
        stroke="currentColor"
        strokeWidth={2}
      >
        <path
          strokeLinecap="round"
          strokeLinejoin="round"
          d="M19 7l-.867 12.142A2 2 0 0116.138 21H7.862a2 2 0 01-1.995-1.858L5 7m5 4v6m4-6v6m1-10V4a1 1 0 00-1-1h-4a1 1 0 00-1 1v3M4 7h16"
        />
      </svg>
    </div>
  );
}
